import './footer.css'
import {MDBFooter,MDBContainer} from "mdbreact";

function footer(){
    return(
        <div className="test">
            <MDBFooter color="green">
                <MDBContainer>
                    test
                </MDBContainer>
            </MDBFooter>
            
        </div>
    );
}

export default footer;
